import styled from 'styled-components';

export const DailyWeatherLoadingWrapper = styled.div`
  position: relative;
  width: 55px;
  height: 55px;
  margin: auto;
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;

  .circularG {
    position: absolute;
    background-color: rgb(0, 0, 0);
    width: 10px;
    height: 10px;
    border-radius: 9px;
    animation-name: bounce_circularG;
    animation-duration: 1.1s;
    animation-iteration-count: infinite;
    animation-direction: normal;
  }

  #circularG_1 {
    left: 0;
    top: 23px;
    animation-delay: 0.41s;
  }

  #circularG_2 {
    left: 6px;
    top: 6px;
    animation-delay: 0.55s;
  }

  #circularG_3 {
    top: 0;
    left: 23px;
    animation-delay: 0.69s;
  }

  #circularG_4 {
    right: 6px;
    top: 6px;
    animation-delay: 0.83s;
  }

  #circularG_5 {
    right: 0;
    top: 23px;
    animation-delay: 0.97s;
  }

  #circularG_6 {
    right: 6px;
    bottom: 6px;
    animation-delay: 1.1s;
  }

  #circularG_7 {
    left: 23px;
    bottom: 0;
    animation-delay: 1.24s;
  }

  #circularG_8 {
    left: 6px;
    bottom: 6px;
    animation-delay: 1.38s;
  }

  @keyframes bounce_circularG {
    0% {
      transform: scale(1);
    }

    100% {
      transform: scale(0.3);
    }
  }
`;
